ヤリイカとオリーブのソテー
チョリソーピザ

インディアンサマーな九月の金曜日。
久々に白ワイン開けて気持ちいい
金曜日の夕方を満喫。

金曜日は、近所のマルシェの日なので
本日もお気に入りに魚屋へ朝一に
行くと、かなりきれいな小ヤリイカ。
イカは、お掃除の手間があるけど、その手間を忘れるほど美味。
ムール貝は、少々のニンニクとオリーブオイル、玉ねぎでさっと炒めて白ワインを加えて蓋して蒸す。
貝が開いたら、生クリーム少々にパセリのみじん切り、胡椒少々を加えて
出来上がり。
今週末は天気も 良さそうだから、
夏の終わりを満喫しよう！

